import React, { Component } from 'react';
import {Link} from 'react-router-dom';
class Menu extends Component {
    render() {
        return (
            <div>
                    <nav>
                        <ui className="nav-links">
                            <Link>
                            </Link>
                            <li>Home</li>
                            <li>Views</li>
                        </ui>
                    </nav>
            </div>
        );
    }
}

export default Menu;
